import React, {Component} from 'react';


class AdminTitlebar extends Component {
  render() {
    <h1>This is the Admin Interface. Thank you for keeping Date-a-base a safe place to date a base, {this.props.username}.</h1>
  }
}


export default AdminTitlebar;
